import React from "react"

import StudentsData from "./StudentsData"

export default function DataTable(){

  const Students = (
    StudentsData.map(studenInfo => {
      return (
        <tr>
          <td>{studenInfo.Code}</td>
          <td lang="ar" value={studenInfo.StudentName}></td>
          <td>{studenInfo.StudentId}</td>
          <td>{studenInfo.Attendance}</td>
          <td>{studenInfo.Participation}</td>
        </tr>
      )
    })
  )

  return (
    <table className="flex justify-center my-9">
      <thead className="bg-black text-white ">
        <tr className="row-header text-3xl">
          <th className="px-1 py-4">Code</th>
          <th className="hidden sm:flex">Student Name</th>
          <th className="hidden sm:flex">Student Id</th>
          <th className="hidden sm:flex">Attendance</th>
          <th className="hidden sm:flex">Participation</th>
        </tr>
      </thead>

      <tbody>
        {/* {Students} */}
      </tbody>
    </table>
  )

}
